const arrayOfData = data.split("\n");
const handles = {
  getAllImages: (tempProduct) => {
    const newImages = [];
    for (let i = 5; i < tempProduct.length; i++) {
      newImages.push(tempProduct[i]);
    }
    return newImages;
  },
  correctDescription: (tempProduct) => {},
};

const newArray = [];
for (const product of arrayOfData) {
  const tempProduct = product.split(",");
  newArray.push({
    name: tempProduct[0],
    description: tempProduct[1],
    stock: tempProduct[2],
    price: tempProduct[3],
    categories: tempProduct[4],
    images: handles.getAllImages(tempProduct),
  });
}

console.log(newArray);

module.exports = newArray;
